INSERT INTO `execution_query` (`ENTITY_CODE`, `EQ_SL_NO`, `EQ_DESC`, `ENTITY`, `EQ_QUERY`, `ACTIVE`, `CR_BY`, `CR_ON`, `MO_BY`, `MO_ON`, `AU_BY`, `AU_ON`, `TBA_MAIN_KEY`) VALUES
	('1', 1, 'SEVADHAR DETAILS', NULL, 'SELECT B.TITLE_DESC||\'.\'||A.CUST_NAME DEVOTEENAME,A.CUST_RES_ADDRESS1  ADDRESS1,A.CUST_RES_ADDRESS2 ADDRESS2,A.CUST_RES_ADDRESS3 ADDRESS3,A.CUST_RES_CITY CITY,DECODE(A.CUST_COMU_PIN_NUM,NULL,\'\',\'Pincode : \'||A.CUST_COMU_PIN_NUM)PINCODE,A.CUST_PHONE_NUM1 PHONE,A.CUST_MOBILE_NUM1 MOBILE,A.CUST_EMAIL_ID1 EMAILID FROM SEVADHAR A ,TITLE B WHERE A.ENTITY_CODE = :1 AND A.CUST_TITLE=B.TITLE_CODE', 'Y', 'ACT1@1', '2021-07-24 16:14:33', NULL, NULL, NULL, NULL, NULL),
	('1', 2, 'ACCOUNT HEADS AS ON BALANCE DETAILS', NULL, 'SELECT GLSUM_GL_CODE GLCODE,GL_DESC GLDESC,DATE(GLSUM_EFF_DATE) EFF_DATE,GLSUM_OPNG_BAL OPENBAL,GLSUM_OPEN_BAL_DRCR DRCR,GLSUM_DR_COUNT DRCOUNT,\r\n		 GLSUM_CR_COUNT CRCOUNT,GLSUM_DR_SUM DRSUM,GLSUM_CR_SUM CRSUM,GLSUM_CLS_BAL CLOSEBAL,GLSUM_CLS_BAL_DRCR DRCR\r\n             FROM GLSUM A,glmast B, maincont C\r\n             WHERE A.ENTITY_CODE = :1 AND A.ENTITY_CODE = B.ENTITY_CODE AND A.ENTITY_CODE = C.ENTITY_CODE \r\n				 AND GL_CODE = GLSUM_GL_CODE AND DATE(GLSUM_EFF_DATE) <= DATE(MN_CURR_BUSINESS_DATE)\r\n				  AND GLSUM_EFF_DATE = (SELECT MAX(GLSUM_EFF_DATE) FROM glsum D WHERE D.ENTITY_CODE =  A.ENTITY_CODE\r\n				 AND D.GLSUM_GL_CODE = A.GLSUM_GL_CODE)\r\n             ORDER BY GLSUM_GL_CODE', 'Y', 'SKVTK1@2', '2021-07-23 23:33:30', NULL, NULL, NULL, NULL, NULL),
	('1', 3, 'DUPLICATE SHASHWATH SEVA LIST', NULL, 'SELECT * FROM VW_DUP_RCPT WHERE ENTITY_CODE = :1 AND COUNT > 1;', 'Y', 'ACT1@1', '2021-07-24 01:27:48', NULL, NULL, NULL, NULL, NULL),
	('1', 4, 'LIST OF DELETED & UPDATED SHASHWATH SEVA', NULL, 'SELECT date(A.SSL_LOG_DATE) PROCESS_DATE,A.SSL_LOG_SL SL,A.SSL_FROM_CUST_CODE || \' - \'||(SELECT C.TITLE_DESC ||\' \'||B.CUST_NAME FROM SEVADHAR B,TITLE C WHERE B.ENTITY_CODE = :1 AND \r\n A.SSL_FROM_CUST_CODE = B.CUST_CODE AND B.CUST_TITLE = C.TITLE_CODE) DEVOTEE_FROM,\r\nCASE WHEN A.SSL_TO_CUST_CODE > 0 THEN\r\n  A.SSL_TO_CUST_CODE || \' - \'||(SELECT C.TITLE_DESC ||\' \'||B.CUST_NAME FROM SEVADHAR B,TITLE C WHERE B.ENTITY_CODE = :1 AND A.SSL_TO_CUST_CODE = B.CUST_CODE AND B.CUST_TITLE = C.TITLE_CODE)\r\nEND DEVOTEE_TO,\r\nDECODE(A.SSL_LOG_TYPE,\'U\',\'Update\',\'D\',\'Delete\') STATUS\r\nFROM SHASHWATH_SEVA_LOG A WHERE A.ENTITY_CODE = :1 \r\nORDER BY A.SSL_LOG_TYPE,A.SSL_LOG_DATE DESC,A.SSL_LOG_SL ', 'Y', 'SKVTK1@2', '2021-07-23 23:37:06', NULL, NULL, NULL, NULL, NULL),
	('1', 5, 'ACCOUNT HEAD AS ON DATE BALANCES', NULL, 'SELECT GLSUM_GL_CODE AS "Account Head", GL_DESC AS "Account Head Description",GLSUM_OPNG_BAL AS "Opening Balance (Rs.)",GLSUM_OPEN_BAL_DRCR AS "Dr/Cr",\r\nGLSUM_DR_SUM AS "Debit Sum (Rs.)",GLSUM_CR_SUM AS "Credit Sum (Rs.)",\r\nGLSUM_CLS_BAL AS "Closing Balance (Rs.)",GLSUM_CLS_BAL_DRCR AS "CB-Dr/Cr"\r\n FROM GLSUM A,GLMAST B,MAINCONT D WHERE A.ENTITY_CODE = :1 AND A.ENTITY_CODE = B.ENTITY_CODE AND A.ENTITY_CODE  = D.ENTITY_CODE  AND GLSUM_GL_CODE  = GL_CODE AND GLSUM_FIN_YEAR = MN_CUR_FIN_YEAR AND GLSUM_EFF_DATE = (SELECT MAX(GLSUM_EFF_DATE) FROM  GLSUM  C WHERE C.ENTITY_CODE  =  A.ENTITY_CODE  AND C.GLSUM_GL_CODE = A.GLSUM_GL_CODE) ORDER BY GLSUM_GL_CODE ;', 'Y', 'SKVTK1@2', '2021-07-24 01:01:56', NULL, NULL, NULL, NULL, NULL),
	('1', 6, 'TEMPLE ASSET DETAILS', NULL, 'SELECT C.ASSET_TYPE_DESC,D.ASSET_SUBTYPE_DESC,B.ITEM_DESC,B.PURCHASE_DATE,B.PURCHASE_QUANTITY,B.INVOICE_NUM,B.DEALER_NAME,B.DEALER_GST_NUM,\r\nB.PURCHASE_AMT,B.CURRENT_QUANTITY,B.CURRENT_VALUE,B.BOOK_VALUE FROM TEMPLE_ASSET A, temple_asset_dtl B, asset_types C, asset_subtypes D WHERE A.ENTITY_CODE=B.ENTITY_CODE AND A.ENTITY_CODE=C.ENTITY_CODE\r\nAND A.ENTITY_CODE=D.ENTITY_CODE AND A.ASSET_TYPE_CODE = B.ASSET_TYPE_CODE AND A.ASSET_TYPE_CODE = C.ASSET_TYPE_CODE AND A.ASSET_TYPE_CODE = D.ASSET_TYPE_CODE\r\nAND B.ASSET_SUBTYPE_CODE = D.ASSET_SUBTYPE_CODE AND A.ACTIVE = \'Y\' AND A.ENTITY_CODE = :1 ', 'Y', 'ACT1@1', '2021-08-04 21:52:41', NULL, NULL, NULL, NULL, NULL),
	('1', 7, 'FACILITIES REPORT', NULL, 'SELECT D.CUST_NAME,C.FACILITY_DESC,B.BOOKING_DATE,DECODE(A.BOOKING_TYPE,\'A\',\'Advance\',\'Normal\') BOOKING_TYPE,A.ADVANCE_AMT,A.ADVANCE_DATE,\r\nE.CHG_DESC,B.FROM_DATE,B.UPTO_DATE,B.CHG_AMT,B.TOT_CHG_AMT,B.BLOCK,B.NUM_DAYS,B.FROM_ROOM_NUM,B.UPTO_ROOM_NUM,B.TOT_ROOM,\r\nDECODE(A.AMOUNT_TYPE,\'C\',\'Cash\',\'B\',\'Clearing\',\'T\',\'Transfer\') AMOUNT_TYPE,\r\nDECODE(A.CLEARING_TYPE,\'C\',\'Cheque\',\'D\',\'DD\',\'T\',\'TT\',\'I\',\'IMPS\',\'N\',\'NEFT\',\'R\',\'RTGS\',\'U\',\'UPI\') CLEARING_TYPE,A.CHQ_NUM,A.CHQ_AMT\r\nFROM facility_booking A, facility_booking_dtl B, facilities C, sevadhar D,facility_charges E WHERE A.ENTITY_CODE = B.ENTITY_CODE \r\nAND A.CUST_CODE = B.CUST_CODE AND A.ENTITY_CODE = C.ENTITY_CODE AND A.ENTITY_CODE = D.ENTITY_CODE AND A.CUST_CODE = D.CUST_CODE\r\nAND A.BOOKING_DATE = B.BOOKING_DATE AND B.FACILITY_TYPE = C.FACILITY_TYPE AND B.FACILITY_CODE = C.FACILITY_CODE\r\nAND A.ENTITY_CODE = E.ENTITY_CODE AND B.FACILITY_TYPE = E.FACILITY_TYPE AND B.CHG_CODE = E.CHG_CODE AND A.ENTITY_CODE = :1 \r\nORDER BY A.CUST_CODE,B.FACILITY_TYPE,B.BOOKING_DATE DESC;', 'Y', 'ACT1@1', '2021-08-04 22:24:42', NULL, NULL, NULL, NULL, NULL),
	('1', 8, 'TEMPLE FESTIVAL/EVENTS CALENDAR', NULL, 'SELECT A.EVENT_DESC,A.EVENT_DATE,E.SAMVATSARA_NAME,D.RITHU,D.MAASA,DECODE(C.PAKSHA,\'K\',\'Krishna Paksha\',\'Shukla Paksha\') PAKSHA,C.THITHI,C.NAKSHATRA,\r\n(SELECT B.CUST_NAME FROM event_list_dtl B WHERE A.ENTITY_CODE = B.ENTITY_CODE AND A.EVENT_CODE = B.EVENT_CODE) SEVADHAR \r\nFROM event_list A, panchanga C, rithu D, samvatsara E,maasa F\r\nWHERE A.MAASA = F.RASHI_CODE AND A.SAMVATSARA = E.SAMVATSARA_NAME\r\nAND A.EVENT_ACTIVE = \'Y\' AND F.RASHI_DESC = D.MAASA AND D.MAASA = C.MAASA AND C.CAL_YEAR = YEAR(A.EVENT_DATE) AND C.CAL_MONTH= MONTH(A.EVENT_DATE) AND C.CAL_DD=DAY(A.EVENT_DATE)\r\nAND A.ENTITY_CODE = :1 ORDER BY A.EVENT_DATE; ', 'Y', 'ACT1@1', '2021-08-04 23:05:18', NULL, NULL, NULL, NULL, NULL),
	('1', 9, 'EMPLOYEE LEAVE LEDGER', NULL, 'SELECT A.EMP_NUM,B.EMP_NAME,A.LEAVE_CODE,A.LEAVE_APPLD_DATE,A.LEAVE_DR_CR,A.LEAVE_FROM_DATE,A.LEAVE_UPTO_DATE,A.OPN_LEAVE_BAL,A.LEAVE_CR,A.LEAVE_DR,A.CLS_LEAVE_BAL,A.FROM_LEAVE_SESSION,A.UPTO_LEAVE_SESSION,A.LEAVE_CANCEL_DATE,DECODE(A.PAT_MAT_LEAVE,\'P\',\'Paternity\',\'M\',\'Maternity\',\'\') PAT_MAT_LEAR\r\n FROM emp_leave_dtl A, employee B,maincont C WHERE A.ENTITY_CODE=B.ENTITY_CODE AND A.EMP_NUM=B.EMP_NUM AND A.ENTITY_CODE = C.ENTITY_CODE AND A.FIN_YEAR=C.MN_CUR_FIN_YEAR AND B.EMP_ACTIVE=\'Y\'\r\n AND A.ENTITY_CODE = :1 ORDER BY A.EMP_NUM,A.LEAVE_CODE,A.LEAVE_FROM_DATE DESC,A.LEAVE_DR_CR DESC', 'Y', 'ACT1@1', '2021-08-06 22:09:56', NULL, NULL, NULL, NULL, NULL),
	('1', 10, 'EMPLOYEE LEAVE SUMMARY', NULL, 'SELECT A.EMP_NUM,B.EMP_NAME,A.LEAVE_CODE,A.OPN_LEAVE_BAL,A.TOT_LEAVE_YEAR_CR,A.TOT_LEAVE_YEAR_DR,A.CLS_LEAVE_BAL,A.LAPSE_LEAVES,A.LAST_CR_DATE,A.LAST_DR_DATE\r\n FROM emp_leave_sumary A, employee B,maincont C WHERE A.ENTITY_CODE=B.ENTITY_CODE AND A.EMP_NUM=B.EMP_NUM AND A.ENTITY_CODE = C.ENTITY_CODE AND A.FIN_YEAR=C.MN_CUR_FIN_YEAR AND B.EMP_ACTIVE=\'Y\'\r\n AND A.ENTITY_CODE = :1 ORDER BY A.EMP_NUM,A.LEAVE_CODE', 'Y', 'ACT1@1', '2021-08-06 22:20:04', NULL, NULL, NULL, NULL, NULL),
	('1', 11, 'Jeernodhara Contributions - Summary', NULL, 'SELECT B.TITLE_DESC||\' \'||A.CUST_NAME DEVOTEENAME,A.CUST_RES_ADDRESS1  ADDRESS1,A.CUST_RES_ADDRESS2 ADDRESS2,A.CUST_RES_ADDRESS3 ADDRESS3,A.CUST_RES_CITY CITY,DECODE(A.CUST_COMU_PIN_NUM,NULL,\'\',\'Pincode : \'||A.CUST_COMU_PIN_NUM)PINCODE,A.CUST_PHONE_NUM1 PHONE,A.CUST_MOBILE_NUM1 MOBILE,A.CUST_EMAIL_ID1 EMAILID,A.CUST_PAN,\r\nSUM(R.RECEIPT_AMT)\r\n FROM SEVADHAR A ,title B, JEERNODHARA_RECEIPT R\r\nWHERE A.ENTITY_CODE = R.ENTITY_CODE AND A.ENTITY_CODE = :1 AND A.CUST_TITLE=B.TITLE_CODE AND A.CUST_CODE = R.CUST_CODE AND R.RECEIPT_TYPE != \'K\'\r\nGROUP BY A.ENTITY_CODE,A.CUST_CODE ORDER BY A.ENTITY_CODE,R.RECEIPT_NUM;', 'Y', 'ACT1@1', '2024-01-24 13:16:55', NULL, NULL, NULL, NULL, NULL),
	('1', 12, 'Jeernodhra Receipt Details', NULL, 'SELECT B.TITLE_DESC||\' \'||A.CUST_NAME DEVOTEENAME,A.CUST_PAN,\r\nR.RECEIPT_NUM,R.RECEIPT_AMT,R.RECEIPT_DATE\r\n,A.CUST_RES_ADDRESS1  ADDRESS1,A.CUST_RES_ADDRESS2 ADDRESS2,A.CUST_RES_ADDRESS3 ADDRESS3,A.CUST_RES_CITY CITY,DECODE(A.CUST_COMU_PIN_NUM,0,\'\',\'Pincode : \'||A.CUST_COMU_PIN_NUM)PINCODE,A.CUST_EMAIL_ID1 EMAILID\r\n,A.CUST_PHONE_NUM1 PHONE,A.CUST_MOBILE_NUM1 MOBILE\r\n FROM SEVADHAR A ,title B, JEERNODHARA_RECEIPT R\r\nWHERE A.ENTITY_CODE = R.ENTITY_CODE AND A.ENTITY_CODE = :1 AND A.CUST_TITLE=B.TITLE_CODE AND A.CUST_CODE = R.CUST_CODE AND R.RECEIPT_TYPE != \'K\'\r\nORDER BY R.ENTITY_CODE,R.RECEIPT_NUM;', 'Y', 'ACT1@1', '2023-11-21 12:16:31', NULL, NULL, NULL, NULL, NULL);
